import * as React from "react";
import ListItem from "../../components/ListItem";
import { FlatList, View, StyleSheet } from "react-native";

const reviews = [
  {
    id: 1,
    title: "Elie Kozah",
    description: "Great job wow highly recommend wow",
    image: require("../../assets/default.jpg"),
  },
  {
    id: 2,
    title: "Fatima Medlij",
    description: "Horrible hate it oh no",
    image: require("../../assets/default.jpg"),
  },
  {
    id: 3,
    title: "Rahaf Zaiter",
    description: "Loved it, good prices and great work!",
    image: require("../../assets/default.jpg"),
  },
];
import ProviderDetails from "../ProviderDetails";
function ProviderDetailsScreen({ navigation }) {
  return (
    <View>
      <ProviderDetails />
      <Text></Text>
      <View style={styles.layout}>
        <FlatList
          data={reviews}
          keyExtractor={(review) => review.id.toString()}
          renderItem={({ item }) => (
            <ListItem

              title={item.title}
              subTitle={item.description}
              image={item.image}
            />
          )}
        />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  layout: {
    flex: 1,
    marginHorizontal: 10,
  },
});
export default ProviderDetailsScreen;
